import React from 'react';
import { NavLink } from "react-router-dom";


export default function Dashboard() {
  return(
    <div>
      <h2>Dashboard</h2>
      <div>
        <nav>
          <NavLink className="nav-link" to="/create">
            Create Job Post
          </NavLink>
        </nav>
      </div>
    </div>
  );
}
